caption = "The host Toronto Raptors defeated the Philadelphia 76ers , 122 - 95 , at Air Canada Center on Monday . The Raptors came into this game as a monster favorite and they did n't leave any doubt with this result . Toronto just continuously piled it on , as they won each quarter by at least four points . The Raptors were lights - out shooting , as they went 55 percent from the field and 68 percent from three - point range . They also held the Sixers to just 42 percent from the field and dominated the defensive rebounding , 34 - 26 . Fastbreak points was a huge difference as well , with Toronto winning that battle , 21 - 6 . Philadelphia ( 4 - 14 ) had to play this game without Joel_Embiid ( rest ) and they clearly did n't have enough to compete with a potent Raptors squad . Robert_Covington had one of his best games of the season though , tallying 20 points , five rebounds , two assists and two steals on 7 - of - 11 shooting . Jahlil_Okafor got the start for Embiid and finished with 15 points and five rebounds . Sergio_Rodriguez , Ersan_Ilyasova , Nik_Stauskas and Richaun_Holmes all finished with 11 points a piece . The Sixers will return to action on Wednesday , when they host the Sacramento Kings for their next game . Toronto ( 11 - 6 ) left very little doubt in this game who the more superior team is . Kyle_Lowry carried the load for the Raptors , accumulating 24 points , four rebounds and eight assists . Terrence_Ross was great off the bench , scoring 22 points on 8 - of - 11 shooting . DeMar_DeRozan finished with 14 points , five rebounds and five assists . Jonas_Valanciunas recorded a double - double , totaling 12 points and 11 rebounds . The Raptors next game will be on Wednesday , when they host the defensively - sound Memphis Grizzlies ."
